// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.17;

contract BoolShortCircuit {
    uint256 public zeroCount = 0;

    function isEven(uint256 num) public pure returns (bool) {
        return num % 2 == 0;
    }

    // isZero函数有副作用，会改变状态变量zeroCount的值
    function isZero(uint256 num) public returns (bool) {
        if (num == 0) {
            zeroCount += 1; // 函数副作用，会改变zeroCount的值
        }
        return num == 0;
    }

    function testShortCircuit(uint256 num1, uint256 num2) public returns (uint256, uint256, uint256, uint256) {
        // 记录初始状态
        zeroCount = 0;

        // 表达式 1
        isEven(num1) && isZero(num2);
        uint256 count1 = zeroCount;

        // 重置zeroCount
        zeroCount = 0;

        // 表达式 2
        isEven(num2) && isZero(num1);
        uint256 count2 = zeroCount;

        // 重置zeroCount
        zeroCount = 0;

        // 表达式 3
        isEven(num2) || isZero(num1);
        uint256 count3 = zeroCount;

        // 重置zeroCount
        zeroCount = 0;

        // 表达式 4
        isEven(num1) || isZero(num2);
        uint256 count4 = zeroCount;

        // 返回四种表达式执行后的zeroCount值
        return (count1, count2, count3, count4);
    }
}

